import { createMuiTheme } from "@material-ui/core/styles";

export default function Theme() {
  const theme = createMuiTheme({
    typography: {
      fontFamily: [
        "Nunito",
        "Roboto",
        '"Helvetica Neue"',
        "Arial",
        "sans-serif",
      ].join(","),
    },
  });
}
